/* mini word-to-diphone dictionary
 changes 14/2/2024
 
1. added more place names
2. remove all apostrophes as causing database errors

There are two types of apostrophes. Apostrophes of possession and contraction. 

Possessive apostrophes indicate ownership of something, like in the following sentences: 
"Dog's birthday" or "Dog's house". Both are pronounced the same: dogz. 
You have to enter the word without anapostrophe e.g. dogs

{"dogs","d-aa aa-g g-z"},

Contraction apostrophes are used to shorten words. For example, "It's a nice day outside" 
expanded as "It is a nice day outside". Use the expanded version with this speech synthesizer.

3. Prounciation

I need to do more research and development on word prounciation with this speech synthesizer. 
It needs to deal with cases such as those below.

Boy's and boys' are pronounced the same: boyz. The final sound here is a Z not an S because of the voiced Y that precedes it.

Friend's and friends' - pronounced the same: frendz.

Parent's and parents' are pronounced the same: parents. They have an S sound at the end because of the voiceless T.

Princess's and princesses' arepronounced the same: princessiz. 

*/

